import './App.css';
import Header from './header';
import s1Main from './Section1-Main';
import BGimage from 'public\Absolute_Reality_v16_BACKGROUND_OF_PASTEL_PINK_AND_WHITE_powde_1.jpg'


function App() {
  return (
    <div className="App bg-gradient-to-r from-teal-400 to-teal-600 ">
      <Header/>
      <s1Main/>
      <img src={BGimage}/>
    </div>
  );
}

export default App;
